import React from 'react';

import Day from './Day';

const days = (props) => props.days.map( ( day, index ) => {
        return <Day
            dt="1406106000"
            icon="http://openweathermap.org/img/w/04d.png"
            weather="Cloudy"
            temp="19" />
      } );

export default days;
